import React, { useState } from "react";
import {
  Modal,
  ModalHeader,
  ModalBody,
  CardBody,
  Button,
  ModalFooter,
} from "reactstrap";

import { useModalEditInfo } from "./../contexts/ModalEditInfoContext";

const ModalEditInfo: React.FC = () => {
  const {
    showModalEditInfo,
    setShowModalEditInfo,
  } = useModalEditInfo();
  const toggle = () => setShowModalEditInfo(!showModalEditInfo);

  return (
    <Modal
      backdrop="static"
      isOpen={showModalEditInfo}
      centered
      toggle={toggle}
    >
      <ModalHeader toggle={toggle}>Edit Info</ModalHeader>
      <ModalBody>
        <CardBody className="p-2 border">

          <ModalFooter className="border-0">
            <Button color="default" onClick={toggle}>
              Close
            </Button>
            <Button color="primary" onClick={() => console.log("")}>
              Forward
            </Button>
          </ModalFooter>
        </CardBody>
      </ModalBody>
    </Modal>
  );
};

export default ModalEditInfo;
